import {  Route, Routes } from 'react-router-dom';

import Layout from 'hoc/layout/layout';

const App: React.FC = () => {
		return (
			<Layout>
				<Routes>
					<Route path='/dashboard' />
				</Routes>
			</Layout>
		);
};

export default App;
